import { Component } from 'react'
import Alert from 'react-s-alert';
import { FaSearch } from 'react-icons/fa'

import MusicVisualizer from './music-visualizer/music-visualizer.js'
import SearchResults from './search-results/search-results.js'
import PlaylistSettings from './playlist-settings/playlist-settings.js'
import SelectedTracks from './selected-tracks/selected-tracks.js'
import DefaultTrack from '~/lib/images/default-track-image.png'

import './generator.scss'



class Generator extends Component {
    constructor(props) {
        super(props)

        this.state = {
            tracks: [{
                artist: '',
                song: '',
                url: '',
                cover: DefaultTrack,
                thumbnail: ''
            }],
            selectedTracks: [],
            playing: false,
            showingDial: false,
            currentTrackIndex: 0,
            playlistSettings: {
                danceability: { min: 1, max: 100, defaultValue: 50, decimal: true, label: 'Danceability', spotifyKey: 'danceability' },
                energy: { min: 1, max: 100, defaultValue: 50, decimal: true, label: 'Energy', spotifyKey: 'energy' },
                instrumentalness: { min: 1, max: 80, defaultValue: 40, decimal: true, label: 'Instrumental', spotifyKey: 'instrumentalness' },
                loudness: { min: -30.0, max: 5.0, defaultValue: -12.0, label: 'Volume', spotifyKey: 'loudness' },
                tempo: { min: 30.0, max: 200.0, defaultValue: 100.0, label: 'Tempo/BPM', spotifyKey: 'tempo' },
                valence: { min: 1, max: 100, defaultValue: 50, decimal: true, label: 'Positivity', spotifyKey: 'valence' }
            }
        }

        this.defaultTrack = [...this.state.tracks]

        this.playListCurrentVals = {
            danceability: 0,
            energy: 0,
            instrumentalness: 0,
            loudness: 0,
            tempo: 0,
            valence: 0
        }

        this.refreshSpotifyAccessToken = this.refreshSpotifyAccessToken.bind(this)
        this.getFromAPI = this.getFromAPI.bind(this)
        this.getTracks = this.getTracks.bind(this)
        this.getTrackAudioFeatures = this.getTrackAudioFeatures.bind(this)
        this.getRecommendations = this.getRecommendations.bind(this)
        this.getCurrentPlaylists = this.getCurrentPlaylists.bind(this)
        this.checkAccessTokenExpiration = this.checkAccessTokenExpiration.bind(this)
        this.updatePlaylistsettings = this.updatePlaylistsettings.bind(this)
        this.searchForTrack = this.searchForTrack.bind(this)
        this.createPlaylist = this.createPlaylist.bind(this)
        this.playMusic = this.playMusic.bind(this)
        this.pauseMusic = this.pauseMusic.bind(this)
        this.selectTrack = this.selectTrack.bind(this)
        this.addTrackToSelected = this.addTrackToSelected.bind(this)
        this.removeTrackFromSelected = this.removeTrackFromSelected.bind(this)
        this.updatePlaylistCurrentVal = this.updatePlaylistCurrentVal.bind(this)
    }

    refreshSpotifyAccessToken() {
        return fetch(`/api/refresh_token?refresh_token=${localStorage.getItem('refreshToken')}`)
            .then(res => res.json().then(json => ({ data: json, status: res.status })))
            .then(res => {
                if (res.status == 200) {
                    localStorage.setItem('accessTokenExpiration', Date.now() + 3600 * 1000)
                    localStorage.setItem('accessToken', res.data.accessToken)
                } else {
                    new Error('Could not refresh access token.')
                }
            })
    }

    async getFromAPI(endpoint, resourceString, method = 'GET', body) {
        await this.checkAccessTokenExpiration()
        const headers = {
            'Authorization': `Bearer ${localStorage.getItem('accessToken')}`,
            'Content-Type': 'application/json'
        }
        return fetch(endpoint, { method, headers, body })
            .then(res => res.json().then(json => res.status >= 200 || res.status < 300 ? json : new Error(`Could not complete the request for ${resourceString}.`)))
    }

    getTracks() { return this.getFromAPI(`https://api.spotify.com/v1/search?type=track&q=${this.refs.searchInput.value}`, 'tracks') }

    getTrackAudioFeatures(id) { return this.getFromAPI(`https://api.spotify.com/v1/audio-features?ids=${id}`, 'track audio features') }

    getRecommendations() {
        var endpointAndQueryString = 'https://api.spotify.com/v1/recommendations?limit=50'
        endpointAndQueryString += `&seed_tracks=${this.state.selectedTracks.map(track => track.id).join(',')}`
        endpointAndQueryString += `&${Object.entries(this.playListCurrentVals)
            .filter(setting => !!setting[1])
            .map(setting => `target_${setting[0]}=${setting[1]}`)
            .join('&')}`
        return this.getFromAPI(endpointAndQueryString, 'recommendations')
    }

    getCurrentPlaylists() { return this.getFromAPI('https://api.spotify.com/v1/me/playlists?limit=50', 'current playlists') }

    getUserInfo() { return this.getFromAPI('https://api.spotify.com/v1/me', 'user info') }

    editPlayListSongs(id, recommendations) {
        var endpointAndQueryString = `https://api.spotify.com/v1/playlists/${id}/tracks?uris=`
        endpointAndQueryString += recommendations.map(track => `spotify:track:${track.id}`).join(',')
        return this.getFromAPI(endpointAndQueryString, 'adding tracks to playlist', 'PUT')
    }

    async makeUserPlaylist() {
        return this.getFromAPI(`https://api.spotify.com/v1/users/${(await this.getUserInfo()).id}/playlists`,
            'creating playlist',
            'POST',
            JSON.stringify({ name: 'moodMojo', description: 'Playlist to match your mood.' }))
    }

    async checkAccessTokenExpiration() {
        if (localStorage.getItem('accessTokenExpiration') <= Date.now())
            await this.refreshSpotifyAccessToken()
        return
    }

    async updatePlaylistsettings(id) {
        const selectedTracks = [...this.state.selectedTracks]

        if (!selectedTracks.length) return

        if (id) {
            const trackAudioFeatures = (await this.getTrackAudioFeatures(id)).audio_features[0]
            const selectedSongIndex = this.state.selectedTracks.findIndex(track => track.id === id)
            const mergedTrackInfo = Object.assign({}, this.state.selectedTracks[selectedSongIndex], trackAudioFeatures)
            selectedTracks.splice(selectedSongIndex, 1, mergedTrackInfo)
        }

        const defaultValues = Object.assign(
            {}, ...Object.entries(
                selectedTracks.reduce((a, b) =>
                    Object.assign(
                        {}, ...Object.keys(a).map(key =>
                            ({ [key]: a[key] + b[key] })
                        )
                    )
                )
            ).map(entry => ({ [entry[0]]: entry[1] / selectedTracks.length }))
        )

        this.setState(({ playlistSettings }) => {
            var newSettings = { ...playlistSettings }
            Object.keys(playlistSettings).forEach(setting => newSettings[setting].defaultValue = newSettings[setting].decimal ? defaultValues[setting] * 100 : defaultValues[setting])
            return { selectedTracks, playlistSettings: newSettings }
        })
    }

    async searchForTrack(e) {
        if (e.charCode === 13 || e.type === "click") {
            this.selectTrack(0)
            var tracks = (await this.getTracks()).tracks.items.map(track => ({
                id: track.id,
                artist: track.artists[0].name,
                song: track.name,
                url: track.preview_url,
                cover: track.album.images[0].url,
                thumbnail: track.album.images[2].url
            }))
            tracks.length ? this.setState({ tracks }) : this.setState({ tracks: this.defaultTrack })
        }
    }

    async createPlaylist() {
        const recommendations = (await this.getRecommendations()).tracks
        const playlists = (await this.getCurrentPlaylists()).items
        const currentPlaylist = playlists.find(playlist => playlist.name === 'moodMojo') || await this.makeUserPlaylist()
        await this.editPlayListSongs(currentPlaylist.id, recommendations)
        Alert.info('Playlist created! Check Your Spotify.', { position: 'top-right', timeout: 5000 });
    }

    playMusic(e, currentTrackIndex = this.state.currentTrackIndex) {
        if (e) e.stopPropagation()
        this.setState({ currentTrackIndex, playing: true, showingDial: true })
    }

    pauseMusic(e) { e.stopPropagation(), this.setState({ playing: false, showingDial: true }) }

    selectTrack(currentTrackIndex) { this.setState({ currentTrackIndex, playing: false, showingDial: false }) }

    addTrackToSelected(e, i) {
        var id = this.state.tracks[i].id
        e.stopPropagation()
        if (!this.state.selectedTracks.filter(track => track.id === id).length && this.state.selectedTracks.length <= 4)
            this.setState(prevState => ({ selectedTracks: [...prevState.selectedTracks, prevState.tracks[i]] }), () => { this.updatePlaylistsettings(id) })
    }

    removeTrackFromSelected(e, id) {
        e.stopPropagation()
        if (this.state.selectedTracks.filter(track => track.id === id).length)
            this.setState(prevState => ({ selectedTracks: prevState.selectedTracks.filter(track => track.id !== id) }), this.updatePlaylistsettings)
    }

    getMusicTrackProps() {
        return { ...this.state, onPause: this.pauseMusic, onPlay: this.playMusic, onAddSelected: this.addTrackToSelected, onRemoveSelected: this.removeTrackFromSelected, selectTrack: this.selectTrack }
    }

    updatePlaylistCurrentVal(key, val) { this.playListCurrentVals[key] = val }

    render() {
        return (
            <div id="generator">
                <div id="firstGenFull" className="full-width-container">
                    <h1>Pick 1-5 Tracks</h1>
                    <MusicVisualizer ref={this.musicVisualizer} {...this.getMusicTrackProps()} />
                    <div id="searchContainer">
                        <div className="search">
                            <input onKeyPress={this.searchForTrack} ref="searchInput" />
                            <FaSearch onClick={this.searchForTrack} />
                        </div>
                        {this.state.tracks[0].song ? <SearchResults {...this.getMusicTrackProps()} /> : null}

                    </div>
                </div>
                <div id="secondGenFull" className="full-width-container">
                    <h1>Fine Tune Your Mood</h1>
                    <SelectedTracks selectedTracks={this.state.selectedTracks} onRemoveSelected={this.removeTrackFromSelected} />
                    <PlaylistSettings playlistSettings={this.state.playlistSettings} onUpdatePlaylistSettings={this.updatePlaylistCurrentVal} />
                    <button style={{ visibility: `${this.state.selectedTracks.length ? 'visible' : 'hidden'}` }} onClick={this.createPlaylist}>Get Your PlayList!</button>
                </div>
            </div>
        )
    }
}

export default Generator
